  height: 350px;
  min-width: 320px;
  border: 1px solid gray;
  margin-bottom: 20px;
  border-radius:
  &:hover {
    box-shadow: 0 3.2px 7.2px 0 rgba(0, 0, 0, 0.132),
      0 0.6px 1.8px 0 rgba(0, 0, 0, 0.108);
  }
`;
const HouseItem = () => {
  return (
    <HouseWrapper>
      <Text>Header</Text>
